int main()
{
	boost::array<double,6> elem;
	double when;

	::kep_toolbox::epoch epoch;
	::pagmo::archipelago a;

	ofstream myfile;
	myfile.open ("out.pagmo");

	int n_multistarts = 1;

	pagmo::algorithm::sa_corana algo1(10000,1,0.01);
	pagmo::algorithm::de algo2(500,0.8,0.8,3);
	pagmo::algorithm::nlopt_sbplx algo3(500,1e-4);

	for (int j=0; j<4406; ++j)
	{
		//define the asteroid elements
		elem[0] = ast_data[j][1] * ASTRO_AU;
		elem[1] = ast_data[j][2];
		elem[2] = ast_data[j][3] * ASTRO_DEG2RAD;
		elem[3] = ast_data[j][5] * ASTRO_DEG2RAD;
		elem[4] = ast_data[j][4] * ASTRO_DEG2RAD;
		elem[5] = ast_data[j][6] * ASTRO_DEG2RAD;
		when    = ast_data[j][0];

		//instantiate the asteroid
		epoch = ::kep_toolbox::epoch(when,::kep_toolbox::epoch::MJD);
		::kep_toolbox::planet target(epoch,elem,ASTRO_MU_SUN,200.0,100.0);

		//build the problem
		pagmo::problem::sample_return prob(target);
		std::cout << "Computing Asteroid ID: " << j << std::endl;

		for (int k=0;k<n_multistarts;++k){
			std::cout << "\tTrial N.: " << k << std::endl;
			a = pagmo::archipelago(pagmo::topology::rim());
			a.push_back(pagmo::island(prob,algo3,20,1.,pagmo::migration::best_s_policy(),pagmo::migration::random_r_policy()));
			a.push_back(pagmo::island(prob,algo1,20));
			a.push_back(pagmo::island(prob,algo2,20));
			a.push_back(pagmo::island(prob,algo1,20));
			a.push_back(pagmo::island(prob,algo2,20));
			a.push_back(pagmo::island(prob,algo1,20));
			a.push_back(pagmo::island(prob,algo2,20));

			a.evolve_t(20000);
			std::vector<double> x = a.get_island(0).get_population().champion().x;
			double time = x[4] + x[6] + x[10];
			myfile << "[" << j << "] " << "[" << time << "] " << a.get_island(0).get_population().champion().f << " " << a.get_island(0).get_population().champion().x << std::endl;
		}
	}
	myfile.close();
	return 0;
}
